import { Route } from "react-router-dom";
import { Switch, Redirect } from "react-router-dom";
import Page1 from "./pages/Page1";
import Page2 from "./pages/Page2";
import MainHeader from "./components/MainHeader";

function App() {
  return (
    <div>

     <MainHeader/>
      <Switch>

      <Route path='/'>
         <Redirect  to="/page1"/>
      </Route>
        <Route path="/page1">
          <Page1 />
        </Route>

        <Route>
          <Page2 />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
